sub create_target_span {
    my $self    = shift;
    my $value   = shift;
    my $type    = shift;
    my $element = HTML::Element->new(
        'span',
        'class' => "entity $type",
        'data-entity-type'  => $type,
        'data-entity-value' => lc($value),
    );
    $element->push_content($value);
    return $element;
}

